// import './App.css';
import React, { useState, useEffect, setIsLoading } from 'react'
import Home from './Pages/Home'

function App() {
	const [list, setList] = useState();
	useEffect(() => {
        const proxyurl = "https://cors-anywhere.herokuapp.com/";
        const url = "https://www.inf.ufpr.br/hvehrenfried/Treinamento/Dados/servidores.json";
        fetch(`${proxyurl}${url}`)
            .then((jsonData) => jsonData.json())
            .then((data) => {
                // setIsLoading(false);
                setList(data);
            })
            .catch((err => {
                console.log("Erro: "+err);
            }));
    }, []);
	return (
		<div className="App">
			<h1>{this.props.list}</h1>
			{/* <Home listFetch={list}/> */}
		</div>
	);
}

export default App;
